import{_ as e,o as t,c as r,O as i}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 58.1-393.1 Extension of time for filing return by pass-through entity.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-393.1.md","filePath":"vacode/58.1-393.1.md"}'),a={name:"vacode/58.1-393.1.md"},n=i('<h1 id="§-58-1-393-1-extension-of-time-for-filing-return-by-pass-through-entity" tabindex="-1">§ 58.1-393.1 Extension of time for filing return by pass-through entity. <a class="header-anchor" href="#§-58-1-393-1-extension-of-time-for-filing-return-by-pass-through-entity" aria-label="Permalink to &quot;§ 58.1-393.1 Extension of time for filing return by pass-through entity.&quot;">​</a></h1><p>A. In accordance with procedures established by the Tax Commissioner, any pass-through entity may elect an extension of time within which to file the report or return required by this article to the date six months after such due date, or 30 days after the extended date for filing the federal report, whichever is later.</p><p>B. If the return is not filed on or before the extended due date elected under subsection A, the penalty imposed by § <a href="http://law.lis.virginia.gov/vacode/58.1-394.1/" target="_blank" rel="noreferrer">58.1-394.1</a> shall apply as if no extension had been granted.</p><p>2004, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?042+ful+CHAP0003" target="_blank" rel="noreferrer">3</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0100" target="_blank" rel="noreferrer">100</a>.</p>',4),o=[n];function s(h,l,f,d,c,p){return t(),r("div",null,o)}const g=e(a,[["render",s]]);export{u as __pageData,g as default};
